import React from 'react';
import { StyleSheet } from 'react-native';


const styles = StyleSheet.create ({
    button: {
        width: 150,
        borderRadius: 50,
        paddingVertical: 14,
        paddingHorizontal: 20,
        backgroundColor: 'chartreuse',        
        
    },

    buttonText: {
        color: 'black',
        fontWeight: 'bold',
        textTransform: 'uppercase',
        fontSize: 16,
        textAlign: 'center',
    },

    view: {
        backgroundColor: '#262A2B',
        height: '90vh',
        alignItems: 'center',
        justifyContent: 'center'
        
    },

    safeView: {
        backgroundColor: '#262A2B',
        height: '100vh',
        
        
    },

    title: {

        fontSize: 24,
        fontWeight: 'bold',
        color: 'white',
        marginHorizontal:120,
        marginTop: 20,
        marginRight:20,
        marginLeft:80,

    },

    input: {
        fontSize: '16px',
        borderColor: 'gray',
        backgroundColor: '#343732',
        width: 280,
        height: 20,  
        marginTop: 50,
        marginBottom: 0,
        marginLeft: 50,

        padding: 5,
      },

})

export default styles;
